import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const AddUser = () => {
  const navigate = useNavigate();
  const House_API = 'http://26.90.237.200:3000/user/add';

  const [id, setId] = useState('');
  const [addName, setAddName] = useState('');
  const [addLastname, setAddLastname] = useState('');
  const [addAddress, setAddAddress] = useState('');
  const [addAge, setAddAge] = useState('');
  const [addPhone, setAddPhone] = useState('');
  const addUser = async () => {
    const data = {
      id: id,
      addName: addName,
      addLastname: addLastname,
      addAddress: addAddress,
      addAge: addAge,
      addPhone: addPhone
      
    };
    try {
      const response = await axios.post(House_API, data);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
    navigate('/Housing');
  };

  return (
    <div className="container">
      <form>
        <div className="mb-3">

        <div>
            <label htmlFor="id" className="form-label">
              เลขบัตรประชาชน
            </label>
            <input
              type="text"
              className="form-control"
              id="id"
              value={id}
              onChange={(e) => setId(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addName" className="form-label">
              ชื่อ
            </label>
            <input
              type="text"
              className="form-control"
              id="addName"
              value={addName}
              onChange={(e) => setAddName(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addLastname" className="form-label">
              นามสกุล
            </label>
            <input
              type="text"
              className="form-control"
              id="addLastname"
              value={addLastname}
              onChange={(e) => setAddLastname(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addAddress" className="form-label">
              ที่อยู่
            </label>
            <input
              type="text"
              className="form-control"
              id="addAddress"
              value={addAddress}
              onChange={(e) => setAddAddress(e.target.value)}
            />
          </div>
         
          <div>
            <label htmlFor="addAge" className="form-label">
              โซน
            </label>
            <input
              type="text"
              className="form-control"
              id="addAge"
              value={addAge}
              onChange={(e) => setAddAge(e.target.value)}
            />
          </div>

          <div>
            <label htmlFor="addPhone" className="form-label">
              โซน
            </label>
            <input
              type="text"
              className="form-control"
              id="addPhone"
              value={addPhone}
              onChange={(e) => setAddPhone(e.target.value)}
            />
          </div>
         
        </div>
        <button type="button" className="btn btn-primary" onClick={addUser}>
          เพิ่มโซน
        </button>
      </form>
    </div>
  );
};

export default AddUser;
